import React from 'react';
import './cta.css';

const ctaData = [
  {
    parentTitle: 'Rent Information & key',
    title: 'Average Rent',
    description: '₹2-2.5 lakhs per month',
  },
  {
    parentTitle: 'Geographical Presence',
    title: 'Title 2',
    description: 'Description for Title 2',
  },
  {
    parentTitle: 'Performance trends over time',
    title: 'Title 3',
    description: 'Description for Title 3',
  },
  {
    parentTitle: 'Customer Feedback',
    title: 'Title 4',
    description: 'Description for Title 4',
  },
];

const CTATile = ({ title, description }) => {
  const handleButtonClick = () => {
    alert(`Clicked on ${title}`);
  };

  return (
    <div className="cta__tile">
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

const ParentTile = ({ parentTitle, children }) => {
  return (
    <div className="cta__parent-tile">
      <h2 className="parent-title">{parentTitle}</h2> {/* Title for parent tile */}
      {children}
    </div>
  );
};

const CTA = () => {
  return (
    <div className="gpt3__cta section__margin">
      <div className="gpt3__cta-content">
        <h1>Data</h1>
      </div>
      <div className="cta__container">
        {ctaData.map((cta, index) => (
          <ParentTile parentTitle={cta.parentTitle} key={index}>
            <CTATile 
              title={cta.title} 
              description={cta.description} 
            />
          </ParentTile>
        ))}
      </div>
    </div>
  );
};

export default CTA;
